import React, { Component } from 'react';

class Categories extends Component {
	
  return (){
	<div className="col-lg-6 mb-4">
		<div className="card bg-info text-white shadow">
			<div className="card-body">
				<p>Category 01</p>
			</div>
		</div>
	</div>
  }

}

export default Categories;
